CREATE TABLE IF NOT EXISTS empdetails (
    `Emp_ID` INT,
    `Name_Prefix` VARCHAR(5) CHARACTER SET utf8,
    `First_Name` VARCHAR(11) CHARACTER SET utf8,
    `Middle_Initial` VARCHAR(1) CHARACTER SET utf8,
    `Last_Name` VARCHAR(11) CHARACTER SET utf8,
    `Gender` VARCHAR(1) CHARACTER SET utf8,
    `E_Mail` VARCHAR(33) CHARACTER SET utf8,
    `Father_s_Name` VARCHAR(20) CHARACTER SET utf8,
    `Mother_s_Name` VARCHAR(20) CHARACTER SET utf8,
    `Mother_s_Maiden_Name` VARCHAR(11) CHARACTER SET utf8,
    `Date_of_Birth` DATE,
    `Time_of_Birth` VARCHAR(11) CHARACTER SET utf8,
    `Weight_in_Kgs` INT,
    `Date_of_Joining` DATE,
    `Salary` INT,
    `Last_Hike` NUMERIC(2, 0),
    `Place_Name` VARCHAR(22) CHARACTER SET utf8,
    `County` VARCHAR(22) CHARACTER SET utf8,
    `City` VARCHAR(22) CHARACTER SET utf8,
    `State` VARCHAR(2) CHARACTER SET utf8,
    `Region` VARCHAR(9) CHARACTER SET utf8
);
